'''Amy Pemberton''' is a British actress and singer best known for her role in the musical ''Rock of Ages''. She has also appeared in television series such as ''My Parents Are Aliens'', ''The Basil Brush Show'', ''Grownups'', ''Casualty'' and ''Doctors'' and the film ''Storage 24''.

In ''[[Game of Thrones: A Telltale Games Series]]'', she voices [[Elaena Glenmore]].
